function addEntries(sectionValue,section,getEntryData,getEntryRelations,output) {

    var prioritySection;
    var priority;
    var fixedData;

    for(var i = 0; i < section.length; i++) {
        prioritySection = section[i];
        priority = prioritySection.priority;

        fixedData = {};
        fixedData.getEntryData = getEntryData;
        fixedData.getEntryRelations = getEntryRelations;
        fixedData.sectionValue = sectionValue;
        fixedData.insertionInfo = {"priority":priority};

        //create the parent ref
        var parentPath = [];

        var keyList = prioritySection.ks;
        if(keyList) {
            addEntriesFromKeyList(keyList,parentPath,fixedData,output);
        }
    }

    //on the last priority section, check for a default
    var entryData = getEntryData(prioritySection);
    var entryRelations = getEntryRelations(prioritySection,[]);

    if(entryData) {
        addDefaultEntry(entryData,entryRelations,fixedData,output);
    }

}

function addEntriesFromKeyList(keyList,parentPath,fixedData,output) {
    for(var i = 0; i < keyList.length; i++) {
        var inEntry = keyList[i];
        addKeyEntry(inEntry,parentPath,fixedData,output);
    }
}

function addKeyEntry(inEntry,parentPath,fixedData,output) {

    //get the key type
    var key;
    var keyType;
    if(inEntry.gk !== undefined) {
        keyType = "gk";
        keyTypeName = "Geometry";
        key = inEntry.gk;
    } 
    else if(inEntry.ek !== undefined) {
        keyType = "ek";
        keyTypeName = "Entity";
        key = inEntry.ek;
    } 
    else if(inEntry.ak !== undefined) {
        keyType = "ak";
        keyTypeName = "Address";
        key = inEntry.ak;
    } 

    if(parentPath.length == 0) {
        parentPath.push(keyType);
    }
    else {
        if(parentPath[0] != keyType) {
            //this is OK, we just don't support it for now.
            throw new Error("child key type does not match parent key type - not supported in translation tool!");
        }
    }

    //update the path for the children
    var localObjectPath = parentPath.concat([key]);

    var entryData = fixedData.getEntryData(inEntry);
    var relations = fixedData.getEntryRelations(inEntry,localObjectPath);

    var sectionName = fixedData.sectionValue[0];
    var name = getKeyName(localObjectPath,keyTypeName,sectionName);

    //note - entry data may be null
    var outEntry = {};
    outEntry.fileType = "themeMap";
    outEntry.insertionInfo = fixedData.insertionInfo;
    outEntry.section = fixedData.sectionValue;
    outEntry.parent_path = parentPath;
    outEntry.entry_type = keyType;
    outEntry.entry_value = key;
    outEntry.name = name;
    outEntry.entry_data = entryData;
    if(relations) {
        outEntry.relations = relations;
    }
    output.push(outEntry);

    //do the children!
    var valueMap = inEntry.v;
    if(valueMap) {
        addEntriesFromValueMap(keyTypeName,valueMap,localObjectPath,fixedData,output);
    }
}

function addEntriesFromValueMap(keyTypeName,valueMap,parentPath,fixedData,output) {
 for(var value in valueMap) {
        var inEntry = valueMap[value];
        addValueEntry(keyTypeName,value,inEntry,parentPath,fixedData,output);
    }
}

function addValueEntry(keyTypeName,value,inEntry,parentPath,fixedData,output) {

    //update the path for the children
    var localObjectPath = parentPath.concat([value]);

    var entryData = fixedData.getEntryData(inEntry);
    var relations = fixedData.getEntryRelations(inEntry,localObjectPath);

    var sectionName = fixedData.sectionValue[0];
    var name = getValueName(localObjectPath,keyTypeName,sectionName);

    //note = entry data may be null
    var outEntry = {};
    outEntry.fileType = "themeMap";
    outEntry.insertionInfo = fixedData.insertionInfo;
    outEntry.section = fixedData.sectionValue;
    outEntry.parent_path = parentPath;
    outEntry.entry_type = "value";
    outEntry.entry_value = value;
    outEntry.name = name;
    outEntry.entry_data = entryData;
    if(relations) {
        outEntry.relations = relations;
    }
    output.push(outEntry);

    //do the children!
    var keyList = inEntry.ks;
    if(keyList) {
        addEntriesFromKeyList(keyList,localObjectPath,fixedData,output);
    }
}


function addDefaultEntry(entryData,entryRelations,fixedData,output) {

    //I am assuming style
    var sectionName = fixedData.sectionValue[0];
    if(sectionName != "style") throw new Error("Only stule default entry is supported in translator!");


    var name = "Default Style: " + entryData.n;

    var outEntry = {};
    outEntry.fileType = "themeMap";
    outEntry.insertionInfo = fixedData.insertionInfo;
    outEntry.section = fixedData.sectionValue;
    outEntry.entry_type = "default";
    outEntry.entry_value = "default";
    outEntry.name = name;
    outEntry.entry_data = entryData;
    if(entryRelations) outEntry.relations = entryRelations;
    output.push(outEntry);
}

function getLabelEntryData(inEntry) {
    var data = {};
    var hasData = false;
    if(inEntry.r !== undefined) {
        data.r = inEntry.r;
        hasData = true;
    }
    if(inEntry.lt !== undefined) {
        data.lt = inEntry.lt;
        hasData = true;
    }
    if(inEntry.trans !== undefined) {
        data.trans = inEntry.trans;
        hasData = true;
    }
    if(hasData) return data;    
    else return null;
}
function getLabelRelations(inEntry,objectPath) {
    var relations = [];

    var presetRelation = getPresetRelation(objectPath);
    if(presetRelation) {
        relations.push(presetRelation);
    }

    if((inEntry.lt == 2)&&(inEntry.r != "<value>")) {
        //icon label
        var iconName = inEntry.r;
        var objectRef = {};
        objectRef.file = "theme";
        objectRef.section = ["icon"];
        objectRef.path = [iconName];

        var relation = {};
        relation.objectRef = objectRef;
        relation.type = "icon source";
    }

    if(relations.length > 0) {
        return relations;
    }
    else {
        return null;
    }
}
function getStyleEntryData(inEntry) {
    if(inEntry.n) {
        var data = {};
        data.n = inEntry.n;
        return data;
    }
}
function getStyleRelations(inEntry,objectPath) {
    var relations = [];

    var presetRelation = getPresetRelation(objectPath);
    if(presetRelation) {
        relations.push(presetRelation);
    }

    if(inEntry.n) {
        var styleName = inEntry.n;
        var objectRef = {};
        objectRef.file = "theme";
        objectRef.section = ["style"];
        objectRef.path = [styleName];

        var relation = {};
        relation.objectRef = objectRef;
        relation.type = "style source";
        relations.push(relation);
    }

    if(relations.length > 0) {
        return relations;
    }
    else {
        return null;
    }
}

function getPresetRelation(themeMapPath) {

    //special case for default entry
    if(themeMapPath.length === 0) return null;

    var section;
    var keyType;
    var presetPath = [];
    for(var i = 0; i < themeMapPath.length; i++) {
        var token = themeMapPath[i];
        if(i == 0) {
            keyType = token;

            //get the tree
            section = getPresetSectionFromKeyType(keyType);
        }
        else {
            if((i == 1)&&(keyType == "gk")) {
                if(isGeomTypeChild(token)) {
                    presetPath.push("geom_type");
                }
            }

            presetPath.push(token);
        }
    }

    var objectRef = {};
    objectRef.file = "presets";
    objectRef.section = section;
    objectRef.path = presetPath;

    var relation = {};
    relation.objectRef = objectRef;
    relation.type = "preset source";

    return relation;
}


function getKeyName(objectPath,keyTypeName,sectionName) {
    var tailPath = apogee.util.deepJsonCopy(objectPath);
    tailPath.shift();
    return tailPath.join(":") + " " + keyTypeName + " Key " + capitalizeFirstLetter(sectionName); 
}

function getValueName(objectPath,keyTypeName,sectionName) {
    var tailPath = apogee.util.deepJsonCopy(objectPath);
    tailPath.shift();
    return tailPath.join(":") + " " + keyTypeName + " " + capitalizeFirstLetter(sectionName);
}

//============================
// Main File Processing Methods
//=============================
function processSection(output,sectionName,sectionEntry) {
    if(!sectionEntry) return;

    var path = [];

    for(var ip = 0; ip < sectionEntry.length; ip++) {
        var priorityEntry = sectionEntry[ip];
        var priority = priorityEntry.priority;

        //get a default rule (should only be on lowest priority)
        var payload = getPayload(priorityEntry);
        if(payload) {
            var outEntry = createEntry(section,priority,path,payload);
            output.push(outEntry);
        }

        var keyList = priorityEntry.ks;
        processKeyList(output,sectionName,priority,path,keyList);
    }
}

function processKeyList(output,section,priority,parentPath,keyList) {
    for(var i = 0; i < keyList.length; i++) {
        var keyEntry = keyList[i];
        processKeyEntry(output,section,priority,parentPath,keyEntry);
    }
}

function processKeyEntry(output,section,priority,parentPath,keyEntry) {
    var keyType;
    if(keyEntry.gk !== undefined) {
        keyType = "gk";
    }
    else if(keyEntry.ek !== undefined) {
        keyType = "ek";
    }
    else if(keyEntry.ak !== undefined) {
        keyType = "ak";
    }
    var keyValue = keyEntry[keyType];

    var path = addKeyToParentPath(parentPath,keyType,keyValue);

    //this does style and label
    var payload = getPayload(keyEntry);
    if(payload) {
        var outEntry = createEntry(section,priority,path,payload);
        output.push(outEntry);
    }

    if(keyEntry.v) {
        processValueMap(output,section,priority,path,keyEntry.v);
    }

}

function processValueMap(output,section,priority,parentPath,valueSet) {
    for(var value in valueSet) {
        var valueEntry = valueSet[value];
        processValueEntry(output,section,priority,parentPath,value,valueEntry);
    }
}

function processValueEntry(output,section,priority,parentPath,value,valueEntry) {
    var path = addValueToParentPath(parentPath,value);

    //this does style and label
    var payload = getPayload(valueEntry);
    if(payload) {
        var outEntry = createEntry(section,priority,path,payload);
        output.push(outEntry);
    }

    if(valueEntry.ks) {
        processKeyList(output,section,priority,path,valueEntry.ks);
    }
}

//============================
// helpers
//=============================
function addKeyToParentPath(parentPath,keyType,keyValue) {
    //creates a new instance (does not modify parentPath)
    return parentPath.concat([[keyType,keyValue]]);
}

function addValueToParentPath(parentPath,value) {
    var pathCopy = apogee.util.deepJsonCopy(parentPath);
    var lastKeyValue = pathCopy[pathCopy.length-1];
    if(lastKeyValue.length !== 2) {
        //sanity check
        throw new Error("expecting a path element with a key and no path");
    }
    lastKeyValue.push(value);
    return pathCopy;
}

//converts a path to a string
function pathToKeyString(path) {
    //get the component entries
    var getComps = function(entry) {
        return entry.join(":");
    }
    var comps = path.map(getComps);
    //sort keys - skip this for now!!!
    //comps.sort();
    //convert to string
    return comps.join(";");
}

function pathToPropertyList(path) {
    var toProps = function(total,entry) {
        var tree = entry[0];
        var key = entry[1];
        //empty string for "any" value
        var value = (entry.length == 3) ? entry[2] : "";

        var treeEntry = total[tree];
        if(treeEntry === undefined) {
            treeEntry = {};
            total[tree] = treeEntry;
        }
        treeEntry[key] = value;
        return total;
    }
    return path.reduce(toProps,{});
}

//this gets the payload from a key or value entry from the style or label section
//returns the payload structure if there is a payload and null if not.
function getPayload(entry) {
    var payload = {};
    var hasData = false;
    for(var key in themeMapPayloadEntries) {
        if(entry[key] !== undefined) {
            payload[key] = entry[key];
            hasData = true;
        }
    }

    return hasData ? payload : null;
}

function createEntry(section,priority,path,payload) {
    var entryData = {};
    entryData.properties = pathToPropertyList(path);
    entryData.payload = payload;

    var entry = {};
    entry.entry_section = section;
    entry.entry_value = pathToKeyString(path);
    entry.entry_data = entryData;
    entry.entry_name = entry.entry_value + " " + section;
    entry.insertion_info = {"priority":priority};

    return entry;
}

