/** This looks up a file type entry. If it is not present it creats a new one. */
function getFileEntry(fileTypeId,prelimEntry,createdFileEntriesStructure,msgList) {
    var fileEntry;

    var section = prelimEntry.entry_section;
    var entryValue = prelimEntry.entry_value;

    var lookupKey = data.getEntryString(fileTypeId,section,entryValue);
    var fileEntryList = localGetEntryListFromRefString(lookupKey,createdFileEntriesStructure);

    var inputEntryData = prelimEntry.entry_data;
    var inputDataEntryRefString = data.getNormalizedString(inputEntryData);
    if(fileEntryList) {
        //look for match
        for(var i = 0; i < fileEntryList.length; i++) {
            var refEntry = fileEntryList[i];
            if(inputDataEntryRefString == refEntry.refString) {
                fileEntry = refEntry.fileEntry;
                break;
            }
        }

    }

    if(!fileEntry) {
        var fields = {};
        fields.file_type_id = fileTypeId;
        fields.entry_context = createSettings.entryContext;
        fields.entry_section = prelimEntry.entry_section;
        fields.entry_value = prelimEntry.entry_value;
        fields.entry_name = prelimEntry.entry_name;
        fields.entry_data = prelimEntry.entry_data;
        fields.option_name = createSettings.entryOptionName;

        fileEntry = micemetarDataAccess.createRecord("file_entry",fields);

        //store this in our created table, for future lookup
        var entryList = createdFileEntriesStructure[lookupKey];
        if(!entryList) {
            entryList = [];
            createdFileEntriesStructure[lookupKey] = entryList;
        }
        entryList.push({
            "fileEntry":fileEntry,
            "refString":inputDataEntryRefString
        });
    }


    return fileEntry;
}

function localGetEntryListFromRefString(lookupKey,createdFileEntriesStructure) {
    var entryList = data.getEntryListFromRefString(lookupKey);
    if(!entryList) {
